              </div>
            </div>

            <div className="form-actions">
              <a href="#" className="forgot-password">
                Mot de passe oubli√© ?
              </a>
            </div>

            <button type="submit" className="submit-button">
              <span>Se Connecter</span>
              <div className="button-animation"></div>
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default App;
